def check_subdomain(subdomain, domain):
    url = f"http://{subdomain}.{domain}"
    try:
        headers = {"User-Agent": random.choice(user_agents)}
        response = requests.get(url, headers=headers,timeout=2)
        if response.status_code == 200:
            print(f"Found {response.status_code}=============================> > > >{url}")
            return url
        else:
            print(f"Not Found {response.status_code} : {url}")
    except Exception as e :
        return None
def find_subdomain(domain,wordlist,threads):
    try:
        with open(wordlist,'r') as file:
            subdomains = file.read().splitlines()
        print("Searching for subdomain")
        found_subdomain=[]
        with ThreadPoolExecutor(max_workers=threads) as executor:
            futures =[executor.submit(check_subdomain,subdomain,domain) for subdomain in subdomains]

            for future in futures:
                result = future.result()
                if result:
                    found_subdomain.append(result) 
        return found_subdomain
    except FileNotFoundError:
        print("file does not exit ")

def Save_file(subdomains,filename):
    try:
        with open(filename,'w') as file:
            for sub in subdomains:
                file.write(sub)
                file.write("\n")
            print(f"THE SUBDOMAINS ARE SAVED >>>>>>>>>>>>>>>{filename}")
    except Exception as e:
        print("[!] Unable To Save :{e}")

