def main():
    display_banner()
    parser = argparse.ArgumentParser(description="Subdomain Finder")
    parser.add_argument("-d", "--domain", required=True, help="Target domain (e.g., example.com)")
    parser.add_argument("-w", "--wordlist", required=True, help="Path to the wordlist file")
    parser.add_argument("-t","--threads",type=int,default=10,help="Number of threads (default: 10)")
    parser.add_argument("-o","--output",default="Subdomain.txt",help="Output file to save the subdomains (default: subdomains.txt)")
    agrs = parser.parse_args()
    target_domain = agrs.domain
    wordlist_path = agrs.wordlist
    threads = agrs.threads
    filename = agrs.output
    subdomains = find_subdomain(target_domain,wordlist_path,threads)
    if subdomains:
        print(" [X]================================[X] ")
        Save_file(subdomains,filename)
        print(" [X]================================[X] ")
    else:
        print("[!] no subdomin found")

if __name__ == "__main__":
    try:
        main()
    except KeyboardInterrupt:
        print("<<<<<<<<<<<Program interrupted by user>>>>>>>>>>>>>>>")
